import './App.css';
import Navbar from '../src/component/Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import Route, BrowserRouter, and Switch

import Home from '../src/component/Home';
import Planet from '../src/component/Planet';
import Species from '../src/component/Species';
import Radiation from '../src/component/Radiation';
import Contact from '../src/component/Contact';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />

          <Route exact path='/' component={Home} />
          <Route path='/planet' component={Planet} />
          <Route path='/species' component={Species} />
          <Route path='/radiation' component={Radiation} />
          <Route path='/contact' component={Contact} />
      </Router>
    </div>
  );
}

export default App;
